const WhiteboardRooom =({} )=>{


  return(
    <div className="container-fluid">
          <div className="row">
        <h1 className="display-5 pt-4 pb-3 text-center">
          Whiteboard -{userNo}
        </h1>
      </div>
    </div>
  )
}

export default WhiteboardRooom;
